import React, {useEffect} from 'react'

function Search({searchFilter, liquors, setLiquors}) {
  useEffect(() => {
    setLiquors(liquors)
  }, [liquors])
  return (
     <div className="center">
    <input
      type="text"
      placeholder="Search..."
      onChange={(e) => searchFilter(e)}
    />
  </div>
  )
}

export default Search
